import Home from '../Components/Home';
import OurDetail from '../Components/OurDetail';
import Partner from '../Components/Partner';
import Footer from '../Components/Footer';
function FrontPage()
{
    return(
        <div>
            <Home/>
            <OurDetail/>
            <Partner/>
            <Footer/>
        </div>
    );
}

export default FrontPage;
